import React from 'react';
import { useNavigate } from 'react-router-dom';

function Project() {
  const navigate = useNavigate()
  return (
    <div>
      <button onClick={() => navigate('ecommerce')}>Ecommerce Website</button>
    </div>
  );
}

export default Project;
